-- Sequence and defined type
CREATE SEQUENCE IF NOT EXISTS fires_id_seq;

-- Table Definition
CREATE TABLE "public"."fires" (
    "id" int4 NOT NULL DEFAULT nextval('fires_id_seq'::regclass),
    "country_id" text,
    "latitude" float4,
    "longitude" float4,
    "brightness" float4,
    "scan" float4,
    "track" float4,
    "acq_date" text,
    "acq_time" int4,
    "confidence" int4,
    "bright_t31" float4,
    "frp" float4,
    "daynight" text,
    PRIMARY KEY ("id")
);

